import React, {useState}  from 'react'
import { BlogContainer, BlogH1 } from './BlogElements'

const Blog1 = () => {
  return (
    <>
        <BlogContainer id="services">
            <BlogH1>ผลวิจัยเผย กักตัวอยู่บ้านเป็นสาหตุที่ทำให้น้ำหนักเพิ่มต่อเนื่อง</BlogH1>

        
        </BlogContainer>
    </>
  )
}

export default Blog1
